import Home from "../components/frontend/Home";
import About from "../components/frontend/About";
import Contact from "../components/frontend/Contact";
import Page403 from "../components/errors/Page403";
import Page404 from "../components/errors/Page404";
import Register from "../components/frontend/auth/Register";
import Login from "../components/frontend/auth/Login";
import ViewCategory from "../components/frontend/collections/ViewCategory";
import ViewProduct from "../components/frontend/collections/ViewProduct";
import ProductDetail from "../components/frontend/collections/ProductDetail";
import Cart from "../components/frontend/Cart";
import Checkout from "../components/frontend/Checkout";
import Thankyou from "../components/frontend/Thankyou";
import DashBoard from "../components/frontend/DashBoard";
import BookDetail from "../components/frontend/book/BookDetail";
import Order from "../components/frontend/Orders";
import OrderDetail from "../components/frontend/OrderDetails";
import { Redirect } from "react-router-dom";

const publicRoutesList = [
  { path: "/", exact: true, name: "Home", component: DashBoard },
  { path: "/about", exact: true, name: "About", component: About },
  { path: "/contact", exact: true, name: "Contact", component: Contact },
  { path: "/403", exact: true, name: "Page403", component: Page403 },
  { path: "/404", exact: true, name: "Page404", component: Page404 },
  { path: "/login", exact: true, name: "Login", component: Login },
  { path: "/register", exact: true, name: "Register", component: Register },
  {
    path: "/books/:id",
    exact: true,
    name: "BookDetail",
    component: BookDetail,
  },
  { path: "/orders", exact: true, name: "BookDetail", component: Order },
  {
    path: "/orders/:id",
    exact: true,
    name: "BookDetail",
    component: OrderDetail,
  },

  {
    path: "/collections",
    exact: true,
    name: "ViewCategory",
    component: ViewCategory,
  },
  {
    path: "/collections/:slug",
    exact: true,
    name: "ViewProduct",
    component: ViewProduct,
  },
  {
    path: "/collections/:category/:product",
    exact: true,
    name: "ProductDetail",
    component: ProductDetail,
  },
  { path: "/cart", exact: true, name: "Cart", component: Cart },
  { path: "/checkout", exact: true, name: "Checkout", component: Checkout },
  { path: "/thank-you", exact: true, name: "Thankyou", component: Thankyou },
  { path: "/*", name: "Redirect", component: <Redirect to="/" /> },
];

export default publicRoutesList;
